import React, {Component} from 'react';

class Pokemon extends Component{
    render(){
        return <div>
            {pokemon = {id: 4, name: 'Charmander', type: 'fire', base_experience: 62}}
            {console.log(pokemon.id)}
        </div>
    }
}

export default Pokemon;
